Nizaar Kinsella | Tuchel: &quot;Maybe it is our fault [Werner's lack of goals] because we have a lot of possession and we push opponent teams very, very deep in their half so spaces are not too big. <br />
<br />
The biggest strength of Timo is to attack the space behind the last line, so it is maybe also our fault in the dominant game that we play in the moment, it is very natural that the spaces are closed by the opponents.&quot;

